function App() {
  return (
    <div className="app">
      <h1>Tu Aplicación</h1>

      <Menu />
      <div className="section">
        <ProductsDetails />
      </div>

      <div className="section">
        <ProductGallery />
      </div>

      <div className="section">
        <ShoppingCart />
      </div>

      <div className="footer">
        Footer de la página
      </div>
    </div>
  );
}

export default App;
